import { useState } from "react";
import {
  getRegularShifts,
  getWorkHours,
  getTimeOffRequests
} from "../../api/peopleApi";

const DAYS = [
  "MONDAY","TUESDAY","WEDNESDAY",
  "THURSDAY","FRIDAY","SATURDAY","SUNDAY"
];

function ScheduleView() {
  const [userId, setUserId] = useState("");
  const [regular, setRegular] = useState([]);
  const [workHours, setWorkHours] = useState([]);
  const [timeOff, setTimeOff] = useState([]);

  const load = async () => {
    if (!userId) return;

    const [r, w, t] = await Promise.all([
      getRegularShifts(userId),
      getWorkHours(userId),
      getTimeOffRequests(userId)
    ]);

    setRegular(r || []);
    setWorkHours(w || []);
    setTimeOff(t || []);
  };

  return (
    <div style={{ maxWidth: 1100 }}>
      <h2>üìÖ Employee Schedule</h2>

      <input
        placeholder="User ID"
        value={userId}
        onChange={e => setUserId(e.target.value)}
      />
      <button onClick={load}>Load</button>

      {/* ================= REGULAR SHIFTS ================= */}
      <h3>üîÅ Regular Weekly Shifts</h3>
      <table border="1" width="100%" cellPadding="6">
        <thead>
          <tr>
            <th>Day</th>
            <th>Start</th>
            <th>End</th>
          </tr>
        </thead>
        <tbody>
          {regular.length === 0 && (
            <tr><td colSpan="3">No regular shifts</td></tr>
          )}
          {regular.map((r, i) => (
            <tr key={i}>
              <td>{r.dayOfWeek}</td>
              <td>{r.startTime}</td>
              <td>{r.endTime}</td>
            </tr>
          ))}
        </tbody>
      </table>

      <br />

      {/* ================= WORK HOURS ================= */}
      <h3>‚è±Ô∏è Actual Work Hours</h3>
      <table border="1" width="100%" cellPadding="6">
        <thead>
          <tr>
            <th>Date</th>
            <th>Check-In</th>
            <th>Check-Out</th>
          </tr>
        </thead>
        <tbody>
          {workHours.length === 0 && (
            <tr><td colSpan="3">No work records</td></tr>
          )}
          {workHours.map((w, i) => (
            <tr key={i}>
              <td>{w.date}</td>
              <td>{w.checkInTime}</td>
              <td>{w.checkOutTime}</td>
            </tr>
          ))}
        </tbody>
      </table>

      <br />

      {/* ================= TIME OFF ================= */}
      <h3>üõë Time-Off Requests</h3>
      <table border="1" width="100%" cellPadding="6">
        <thead>
          <tr>
            <th>Date</th>
            <th>From</th>
            <th>To</th>
            <th>Approved</th>
          </tr>
        </thead>
        <tbody>
          {timeOff.length === 0 && (
            <tr><td colSpan="4">No time-off requests</td></tr>
          )}
          {timeOff.map((t, i) => (
            <tr key={i}>
              <td>{t.date}</td>
              <td>{t.startTime}</td>
              <td>{t.endTime}</td>
              <td>{t.approved ? "‚úÖ Yes" : "‚è≥ Pending"}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default ScheduleView;
